\":false},\"text\":\"<p>Preenche as palavras em falta</p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":49,\"feedback\":\"Opss... Tens que te orientar melhor no espaço...\"},{\"from\":50,\"to\":100,\"feedback\":\"Excelente... Estás completamente orientado!!!\"}],\"showSolutions\":\"Mostrar solução\",\"tryAgain\":\"Tentar novamente\",\"checkAnswer\":\"Verificar\",\"submitAnswer\":\"Por favor, preencha todos os espaços em branco para visualizar a solução\",\"notFilledOut\":\"Por favor preencha todos os espaços em branco\",\"answerIsCorrect\":\"':ans' está correta\",\"answerIsWrong\":\"':ans' está incorreta\",\"answeredCorrectly\":\"Respondido incorretamente\",\"answeredIncorrectly\":\"Respondido corretamente\",\"solutionLabel\":\"Espaço em branco @num de @total\",\"inputLabel\":\"Resposta aberta @num de um total de @total\",\"inputHasTipLabel\":\"Dica disponível\",\"tipLabel\":\"Dica\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"autoCheck\":false,\"caseSensitive\":true,\"showSolutionsRequiresInput\":true,\"separateLines\":false,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"acceptSpellingErrors\":false},\"scoreBarLabel\":\"Conseguiu :num pontos de um total de :total\",\"a11yCheck\":\"Mostrar a solução. A atividade será marcada com a respetiva solução correta.\",\"a11yShowSolution\":\"Mostrar a solução. A tarefa será marcada com a sua solução correta.\",\"a11yRetry\":\"Tente de novo. Apagar todas as respostas e iniciar de novo.\",\"a11yCheckingModeHeader\":\"Modo de verificação\",\"confirmCheck\":{\"header\":\"Tentar novamente?\",\"body\":\"Tem a certeza de que pretende tentar novamente?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Terminar\"},\"confirmRetry\":{\"header\":\"Repetir ?\",\"body\":\"Tem a certeza que deseja repetir?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Confirmar\"},\"questions\":[\"<p>Na imagem podemos ver um prisma no referêncial.</p>\\n\\n<p>O ponto B situa-se no *primeiro/1º* diedro porque tem todas as *coordenadas* positivas.</p>\\n\\n<p>Os pontos C e D, apesar de se situarem no mesmo *diedro* que o ponto B, têm *abcissa* negativa.</p>\\n\\n<p>O ponto F, devido ao facto de se situar no *segundo/2º* diedro, tem afastamento *negativo* e cota *positiva*.</p>\\n\\n<p>Os pontos A, D e E pertencem ao plano *horizontal* de projeção, já que as suas *cotas* são nulas.</p>\\n\"]},\"metadata\":{\"embedTypes\":[\"iframe\"],\"language\":\"en\",\"defaultLanguage\":\"pt\",\"license\":\"U\",\"extraTitle\":\"Localização de pontos no espaço\",\"title\":\"Localização de pontos no espaço\",\"mainLibrary\":\"H5P.Blanks\",\"preloadedDependencies\":[{\"machineName\":\"H5P.Image\",\"majorVersion\":1,\"minorVersion\":1},{\"machineName\":\"FontAwesome\",\"majorVersion\":4,\"minorVersion\":5},{\"machineName\":\"H5P.Question\",\"majorVersion\":1,\"minorVersion\":5},{\"machineName\":\"H5P.JoubelUI\",\"majorVersion\":1,\"minorVersion\":3},{\"machineName\":\"H5P.Transition\",\"majorVersion\":1,\"minorVersion\":0},{\"machineName\":\"H5P.FontIcons\",\"majorVersion\":1,\"minorVersion\":0},{\"machineName\":\"H5P.TextUtilities\",\"majorVersion\":1,\"minorVersion\":3},{\"machineName\":\"H5P.Blanks\",\"majorVersion\":1,\"minorVersion\":14}],\"authors\":[],\"changes\":[],\"contentType\":\"Preencher as lacunas (Fill in the Blanks)\"},\"subContentId\":\"a6ceb5b4-5c30-4483-8dc4-3e63f8f9af80\"},{\"library\":\"H5P.MultiChoice 1.16\",\"params\":{\"media\":{\"type\":{\"params\":{\"decorative\":false,\"contentName\":\"Imagem\",\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\",\"alt\":\"Localização no espaço\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAgIAHAAcAAD/4RtyRXhpZgAATU0AKgAAAAgABwESAAMAAAABAAEAAAEaAAUAAAABAAAAYgEbAAUAAAABAAAAagEoAAMAAAABAAMAAAExAAIAAAAcAAAAcgEyAAIAAAAUAAAAjodpAAQAAAABAAAApAAAANAABFNJAAAnEAAEU0kAACcQQWRvYmUgUGhvdG9zaG9wIENTMyBXaW5kb3dzADIwMjQ6MTA6MjQgMTc6NTc6MTIAAAAAA6ABAAMAAAABAAEAAKACAAQAAAABAAACN6ADAAQAAAABAAACDgA
